    first: 1000
    skip: $skip
    orderBy: date
    orderDirection: asc
    where: {pairAddress: $pairAddress}
  ) {
    id
    date
    dailyVolumeToken0
    dailyVolumeToken1
    dailyVolumeUSD
    reserveUSD
    __typename
  }
}
"}

